  return (
    <div className="footer">
      <div className="footer-left">
        <h6>Liên Hệ</h6>
        <ul>
          <li>
            CÔNG TY TNHH DỊCH VỤ VÀ PHÁT TRIỂN CÔNG NGHỆ PROTECH Địa chỉ:
            A30-TT2 Khu đô thị Văn Quán - Hà Đông - Hà Nội Hotline: 0913.434.968
            Điện thoại: 0913.434.968 Zalo: 0913.434.968 Email:
            techinplay@gmail.com Facebook
          </li>
          <li>Địa chỉ: A30-TT2 Khu đô thị Văn Quán - Hà Đông - Hà Nội</li>
          <li>
            Hotline: <a href="tel"></a>
          </li>
          <li></li>
          <li></li>
          <li></li>
          <li></li>
        </ul>
      </div>
      <div className="footer-center">2</div>
      <div className="footer-right">3</div>
    </div>
  );
};

export default Footer;
